import React from 'react'
import './App.css';
import HomeScreen from './components/HomeScreen';
import AdminPanel from './components/AdminPanel';

function App() {

  const [startPage, setStartPage] = React.useState(true)

  function handleAdmin(){
    setStartPage(prevStart => !prevStart)
  }


  return (
    <div className="App">
    {startPage && <HomeScreen handleAdmin={handleAdmin}/>}
    {!startPage && <AdminPanel handleAdmin={handleAdmin}/>}
    </div>
  );
}

export default App;
